[{"operationName":"CourseSchemaMarkupQuery","variables":{"courseId":"jnLavMk5EeeVPQ7WIasyYA"},"query":"query CourseSchemaMarkupQuery($courseId: String!) {
  CoursesV1Resource {
    get(id: $courseId) {
      id
      slug
      name
      description
      domainTypes {
        domainId
        __typename
      }
      courseStatus
      photoUrl
      primaryLanguages
      instructors {
        elements {
          id
          fullName
          shortName
          title
          photo
          websites {
            website
            __typename
          }
          __typename
        }
        __typename
      }
      partners {
        elements {
          id
          name
          shortName
          links {
            website
            __typename
          }
          __typename
        }
        __typename
      }
      courseDerivatives {
        id
        averageFiveStarRating
        ratingCount
        __typename
      }
      __typename
    }
    __typename
  }
  OnDemandSessionsV1Resource {
    currentOpenByCourse(courseId: $courseId) {
      elements {
        id
        startedAt
        endedAt
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"semiPersonalizedRecommendationsQuery","variables":{"id":"people-who-viewed-converted-cdp-algo$course~jnLavMk5EeeVPQ7WIasyYA$no_attribute"},"query":"query semiPersonalizedRecommendationsQuery($id: String!) {
  SemiPersonalizedRecsModulesV1Resource {
    get(id: $id) {
      id
      entities {
        entityId
        __typename
      }
      courses {
        elements {
          s12ns {
            elements {
              id
              __typename
            }
            __typename
          }
          id
          slug
          name
          partnerIds
          photoUrl
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          courseTypeMetadata {
            courseTypeMetadata {
              ...RhymeProjectFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      s12ns {
        elements {
          id
          name
          productVariant
          courses {
            paging {
              total
              __typename
            }
            __typename
          }
          logo
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          slug
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}
"},{"operationName":"coursesQuery","variables":{"courseIds":["lVXdKg4PEee3mA5YKds-dg","2x3878rgEee3yRKskKT_NA","WwC0idEkEeer0xJUQzVHIg"]},"query":"query coursesQuery($courseIds: [String!]!) {
  CoursesV1Resource {
    multiGet(ids: $courseIds) {
      elements {
        id
        slug
        name
        partnerIds
        photoUrl
        partners {
          elements {
            id
            name
            squareLogo
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
